import React, { useState, useEffect, useRef } from 'react';
import Lottie from "lottie-react";
import Loading from '../../animations/Loadingskeleton.json'
import style from './style.module.css';
import RoundedButton from '../common/RoundedButton/RoundedButton';
import Lenis from '@studio-freight/lenis';
import { motion, useScroll, useTransform } from 'framer-motion';
const apiUrl = process.env.REACT_APP_API_URL;

export default function Products() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true); // Set initial loading state to true
  const containerRef = useRef(null); // Reference to the container div

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await fetch("https://v2.api.noroff.dev/online-shop");
        if (!response.ok) {
          throw new Error('Failed to fetch products');
        }
        const data = await response.json();
        console.log(data); // Log the response
        setProducts(data.data); // Assuming the products are under the 'data' key
      } catch (error) {
        console.error('Error fetching products:', error);
      } finally {
        setLoading(false); // Set loading to false regardless of success or failure
      }
    };

    fetchProducts();
  }, []);

  const container = useRef(null);
  const { scrollYProgress } = useScroll({
      target: container,
      offset: ['start end', 'end start']
  })
  const sm = useTransform(scrollYProgress, [0, 1], [0, -50]);
  const md = useTransform(scrollYProgress, [0, 1], [0, -150]);
  const lg = useTransform(scrollYProgress, [10, 8], [0, -250]);



  return (
    <div ref={container} className={style.Container}>
          <motion.div>
      <svg viewBox="0 0 100 100" width="100" height="100">
        <defs>
          <path id="circle"
            d="
              M 50, 50
              m -37, 0
              a 37,37 0 1,1 74,0
              a 37,37 0 1,1 -74,0"/>
        </defs>
        <text fontSize="17">
          <motion.h1></motion.h1>
          <textPath href="#circle" style={{y: sm}}>
          <motion.h1>   Todays special offers...</motion.h1>

          </textPath>
        </text>
      </svg>

      {loading ? (
        <div className={style.Loader}>
          <Lottie animationData={Loading} width={20} height={20} style={{height: "300px", width: "auto", overflow: "auto"}}/>
          <Lottie animationData={Loading} width={20} height={20} style={{height: "300px", width: "auto", overflow: "auto"}}/>
          <Lottie animationData={Loading} width={20} height={20} style={{height: "300px", width: "auto", overflow: "auto"}}/>
        </div>
      ) : (
        <div className={style.Products}>
          {/* Rendering only the first three products */}
          {products.slice(0, 3).map((product, index) => (
            <div 
              key={product.id} 
              className={style.Product}
            >
              <img src={product.image.url} alt={product.title} style={{lg}}/>
              <h1 style={{md}}>{product.title}</h1>
              <h3>{product.description}</h3>
              <p className={style.Old}>Price: ${product.price}</p>
              <span>New Price</span>
              <h2 style={{lg}}>{product.discountedPrice}</h2>
              <div className={style.Button}>
                <RoundedButton><p>Add to cart</p></RoundedButton>
              </div>
            </div>
          ))}
        </div>

      )}
      </motion.div>
    </div>
  );
}
